// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

// Total supply of tickets
uint256 constant TOTAL_TICKETS = 10;

contract Tickets {
    address public owner = msg.sender;

    event Created(uint256 indexed index, Ticket ticket);

    struct Ticket {
        uint256 price;
        address owner;
    }

    Ticket[] public tickets;

    // constructor() {
    //     for (uint256 i = 0; i < TOTAL_TICKETS; i++) {
    //         tickets[i].price = 1e17; // 0.1 ETH
    //         tickets[i].owner = address(0x0);
    //         emit Created(i, tickets[i]);
    //     }
    // }

    function mint() external payable {
        require(msg.value >= 1e17);
        tickets.push(Ticket(1e17, msg.sender));
        emit Created(tickets.length, tickets[tickets.length - 1]);
    }

    function buyTickets(uint256 _index) external payable {
        require(_index < TOTAL_TICKETS && _index >= 0);
        require(tickets[_index].owner == address(0x0));
        require(msg.value >= tickets[_index].price);
        tickets[_index].owner = msg.sender;
    }

    function getNumberTickets() public view returns (uint256) {
        return tickets.length;
    }

    function getTickets() public view returns (uint256, address) {
        return (tickets[0].price, tickets[0].owner);
    }
}
